import React from 'react'

export const CarouselAsos = () => {
    const images = [
        {
            "img1": url("../assets/img/rugbyinfantil.webp"),
            "img2": url("../assets/img/22a.jpg"),
        }
        
    ]

  return (
    <div className='max-w-[1400px] h-[780px] m-auto py-16 px-4 relative'>
        <div className='w-full h-full rounded-3xl bg-center bg-cover duration-500'>
            {images.map((s)=>{
                return (
                    <img src={s} alt=""  />
                )
            })}

        </div>

    </div>
  )
};
